import React from 'react';

function ExperienceSection() {
  return (
    <section id="experience" className="container mt-5">
      <h2>Experience</h2>
      <ul className="list-unstyled">
        <li>Internship at XYZ Company - Developed a full-stack application...</li>
        <li>Volunteer Developer at ABC Organization - Contributed to open-source projects...</li>
        {/* More experiences */}
      </ul>
    </section>
  );
}

export default ExperienceSection;
